INSERT INTO `mails_logs` (`mail_id`, `content`, `subject`, `to_email`, `can_id`, `job_id`) VALUES
	(1, '<p>Kính gửi Phạm Mai Sơn Hữu,</p><p>Chúng tôi rất vui mừng thông báo rằng sau khi xem xét hồ sơ và năng lực của bạn, bạn đã được đề cử cho vị trí <strong>Central Facilitator</strong> tại <strong>Chi nhánh Thảo</strong>.</p><p>Đây là cơ hội tuyệt vời để bạn gia nhập một đội ngũ năng động và góp phần vào sự phát triển của công ty. Chúng tôi tin tưởng rằng kỹ năng và kinh nghiệm của bạn rất phù hợp với yêu cầu của vị trí này, và bạn sẽ là một thành viên tuyệt vời của đội ngũ.</p><p>Chúng tôi xin mời bạn tham gia một cuộc phỏng vấn để thảo luận chi tiết về công việc và các bước tiếp theo trong quy trình tuyển dụng. Vui lòng cho chúng tôi biết thời gian có thể tham gia phỏng vấn bằng cách trả lời email này hoặc liên hệ với chúng tôi qua số điện thoại/email: (340) 725-6058/bighead@nipplealert.test.</p><p>Cảm ơn bạn đã quan tâm đến việc gia nhập Chi nhánh Thảo. Chúng tôi rất mong sớm nhận được phản hồi từ bạn.</p><p>Trân trọng,</p><p>HR Department<br>Chi nhánh Thảo</p>', 'Chi nhánh Thảo - Application for Central Facilitator Position - Phạm Mai Sơn Hữu', 'laurie@raviga.test', 51, 144),
	(2, '<p>Kính gửi Tô Phạm,</p><p>Chúng tôi rất vui mừng thông báo rằng sau khi xem xét hồ sơ và năng lực của bạn, bạn đã được đề cử cho vị trí <strong>Central Facilitator</strong> tại <strong>Chi nhánh Thảo</strong>.</p><p>Đây là cơ hội tuyệt vời để bạn gia nhập một đội ngũ năng động và góp phần vào sự phát triển của công ty. Chúng tôi tin tưởng rằng kỹ năng và kinh nghiệm của bạn rất phù hợp với yêu cầu của vị trí này, và bạn sẽ là một thành viên tuyệt vời của đội ngũ.</p><p>Chúng tôi xin mời bạn tham gia một cuộc phỏng vấn để thảo luận chi tiết về công việc và các bước tiếp theo trong quy trình tuyển dụng. Vui lòng cho chúng tôi biết thời gian có thể tham gia phỏng vấn bằng cách trả lời email này hoặc liên hệ với chúng tôi qua số điện thoại/email: (340) 725-6058/bighead@nipplealert.test.</p><p>Cảm ơn bạn đã quan tâm đến việc gia nhập Chi nhánh Thảo. Chúng tôi rất mong sớm nhận được phản hồi từ bạn.</p><p>Trân trọng,</p><p>HR Department<br>Chi nhánh Thảo</p>', 'Chi nhánh Thảo - Application for Central Facilitator Position - Tô Phạm', 'monica@raviga.test', 74, 144),
